s_changed_handler_id .replace(Some(tasks_changed_handler_id)); // Set current tasks self.imp().current_collection.replace(Some(collection)); self.select_collection_row(); } fn set_task_list_visible(&self, tasks: &gio::ListStore) { self.imp().tasks_list.set_visible(tasks.n_items() > 0); } fn select_collection_row(&self) { if let Some(index) = self.collections().find(&self.current_collection()) { let row = self.imp().collections_list.row_at_index(index as i32); self.imp().collections_list.select_row(row.as_ref()); } } fn create_task_row(&self, task_object: &TaskObject) -> ActionRow { // Create check button let check_button = CheckButton::builder() .valign(Align::Center) .can_focus(false) .build(); // Create row let row = ActionRow::builder() .activatable_widget(&check_button) .build(); row.add_prefix(&check_button); // Bind properties task_object .bind_property(\\"completed\\", &check_button, \\"active\\") .bidirectional() .sync_create() .build(); task_object .bind_property(\\"content\\", &row, \\"title\\") .sync_create() .build(); // Return row row } fn setup_callbacks(&self) { // Setup callback for activation of the entry self.imp().entry.connect_activate(clone!( #[weak(rename_to = window)] self, move |_| { window.new_task(); } )); // Setup callback for clicking (and the releasing) the icon of the entry self.imp().entry.connect_icon_release(clone!( #[weak(rename_to = window)] self, move |_, _| { window.new_task(); } )); // Filter model whenever the value of the key \\"filter\\" changes self.settings().connect_changed( Some(\\"filter\\"), clone!( #[weak(rename_to = window)] self, move |_, _| { window.set_filter(); } ), ); // Setup callback when items of collections change self.set_stack(); self.collections().connect_items_changed(clone!( #[weak(rename_to = window)] self, move |_, _, _, _| { window.set_stack(); } )); // Setup callback for activating a row of collections list self.imp().collections_list.connect_row_activated(clone!( #[weak(rename_to = window)] self, move |_, row| { let index = row.index(); let selected_collection = window .collections() .item(index as u32) .expect(\\"There needs to be an object at this position.\\") .downcast::<CollectionObject>() .expect(\\"The object needs to be a `CollectionObject`.\\"); window.set_current_collection(selected_collection); window.imp().split_view.set_show_content(true); } )); } fn set_stack(&self) { if self.collections().n_items() > 0 { self.imp().stack.set_visible_child_name(\\"main\\"); } else { self.imp().stack.set_visible_child_name(\\"placeholder\\"); } } fn new_task(&self) { // Get content from entry and clear it let buffer = self.imp().entry.buffer(); let content = buffer.text().to_string(); if content.is_empty() { return; } buffer.set_text(\\"\\"); // Add new task to model let task = TaskObject::new(false, content); self.tasks().append(&task); } fn setup_actions(&self) { // Create action from key \\"filter\\" and add to action group \\"win\\" let action_filter = self.settings().create_action(\\"filter\\"); self.add_action(&action_filter); } fn remove_done_tasks(&self) { let tasks = self.tasks(); let mut position = 0; while let Some(item) = tasks.item(position) { // Get `TaskObject` from `glib::Object` let task_object = item .downcast_ref::<TaskObject>() .expect(\\"The object needs to be of type `TaskObject`.\\"); if task_object.is_completed() { tasks.remove(position); } else { position += 1; } } } async fn new_collection(&self) { // Create entry let entry = Entry::builder() .placeholder_text(\\"Name\\") .activates_default(true) .build(); let cancel_response = \\"cancel\\"; let create_response = \\"create\\"; // Create new dialog let dialog = AlertDialog::builder() .heading(\\"New Collection\\") .close_response(cancel_response) .default_response(create_response) .extra_child(&entry) .build(); dialog .add_responses(&[(cancel_response, \\"Cancel\\"), (create_response, \\"Create\\")]); // Make the dialog button insensitive initially dialog.set_response_enabled(create_response, false); dialog.set_response_appearance(create_response, ResponseAppearance::Suggested); // Set entry\'s css class to \\"error\\", when there is no text in it entry.connect_changed(clone!( #[weak] dialog, move |entry| { let text = entry.text(); let empty = text.is_empty(); dialog.set_response_enabled(create_response, !empty); if empty { entry.add_css_class(\\"error\\"); } else { entry.remove_css_class(\\"error\\"); } } )); let response = dialog.choose_future(Some(self)).await; // Return if the user chose `cancel_response` if response == cancel_response { return; } // Create a new list store let tasks = gio::ListStore::new::<TaskObject>(); // Create a new collection object from the title the user provided let title = entry.text().to_string(); let collection = CollectionObject::new(&title, tasks); // Add new collection object and set current tasks self.collections().append(&collection); self.set_current_collection(collection); // Show the content self.imp().split_view.set_show_content(true); } }","breadcrumbs":"Libadwaita Â» Adding Collections Â» Window","id":"101","title":"Window"},"102":{"body":"There isnâ€™t yet a way to add a collection.\\nLetâ€™s implement that functionality. A video which shows the new dialog The screencast above demonstrates the desired behavior.\\nWhen we activate the button with the + symbol, a dialog appears.\\nWhile the entry is empty, the â€œCreateâ€ button remains insensitive.\\nAs soon as we start typing, the button becomes sensitive.\\nWhen we remove all typed letters and the entry becomes empty again, the â€œCreateâ€ button becomes insensitive and the entry gets the â€œerrorâ€ style.\\nAfter clicking the â€œCreateâ€ button, a new collection is created, and we navigate to its task view. To implement that behavior we will first add a â€œnew-collectionâ€ action to class_init method.\\nThis action will be activated by a click on the + button as well as on the button in the placeholder page.\\nWe are using install_action_async.\\nIt is a convenient way to add asynchronous actions to subclassed widgets. Filename: listings/todo/8/window/imp.rs use std::cell::RefCell; use std::fs::File; use adw::subclass::prelude::*; use adw::{NavigationSplitView, prelude::*}; use gio::Settings; use glib::subclass::InitializingObject; use gtk::glib::SignalHandlerId; use gtk::{CompositeTemplate, Entry, FilterListModel, ListBox, Stack, gio, glib}; use std::cell::OnceCell; use crate::collection_object::{CollectionData, CollectionObject}; use crate::utils::data_path; // Object holding the state #[derive(CompositeTemplate, Default)] #[template(resource = \\"/org/gtk_rs/Todo8/window.ui\\")] pub struct Window { pub settings: OnceCell<Settings>, #[template_child] pub entry: TemplateChild<Entry>, #[template_child] pub tasks_list: TemplateChild<ListBox>, // ðŸ‘‡ all members below are new #[template_child] pub collections_list: TemplateChild<ListBox>, #[template_child] pub split_view: TemplateChild<NavigationSplitView>, #[template_child] pub stack: TemplateChild<Stack>, pub collections: OnceCell<gio::ListStore>, pub current_collection: RefCell<Option<CollectionObject>>, pub current_filter_model: RefCell<Option<FilterListModel>>, pub tasks_changed_handler_id: RefCell<Option<SignalHandlerId>>, } // The central trait for subclassing a GObject\\n#[glib::object_subclass]\\nimpl ObjectSubclass for Window { // `NAME` needs to match `class` attribute of template const NAME: &\'static str = \\"TodoWindow\\"; type Type = super::Window; type ParentType = adw::ApplicationWindow; fn class_init(klass: &mut Self::Class) { klass.bind_template(); // Create action to remove done tasks and add to action group \\"win\\" klass.install_action(\\"win.remove-done-tasks\\", None, |window, _, _| { window.remove_done_tasks(); }); // Create async action to create new collection and add to action group \\"win\\" klass.install_action_async( \\"win.new-collection\\", None, |window, _, _| async move { window.new_collection().await; }, ); } fn instance_init(obj: &InitializingObject<Self>) { obj.init_template(); }\\n} // Trait shared by all GObjects impl ObjectImpl for Window { fn constructed(&self) { // Call \\"constructed\\" on parent self.parent_constructed(); // Setup let obj = self.obj(); obj.setup_settings(); obj.setup_collections(); obj.restore_data(); obj.setup_callbacks(); obj.setup_actions(); } } // Trait shared by all widgets impl WidgetImpl for Window {} // Trait shared by all windows impl WindowImpl for Window { fn close_request(&self) -> glib::Propagation { // Store task data in vector let backup_data: Vec<CollectionData> = self .obj() .collections() .iter::<CollectionObject>() .filter_map(|collection_object| collection_object.ok()) .map(|collection_object| collection_object.to_collection_data()) .collect(); // Save state to file let file = File::create(data_path()).expect(\\"Could not create json file.\\"); serde_json::to_writer(file, &backup_data) .expect(\\"Could not write data to json file\\"); // Pass close request on to the parent self.parent_close_request() } } // Trait shared by all application windows impl ApplicationWindowImpl for Window {} // Trait shared by all adwaita application windows impl AdwApplicationWindowImpl for Window {} As soon as the â€œnew-collectionâ€ action is activated, the async new_collection method is called.\\nHere, we create the adw::AlertDialog, set up the buttons as well as add the entry to it.\\nWe add a callback to the entry to ensure that when the content changes, an empty content sets dialog_button as insensitive and adds an â€œerrorâ€ CSS class to the entry.\\nWe then await on the user pressing a button on the dialog.\\nIf they click â€œCancelâ€, we simply return.\\nHowever, if they click â€œCreateâ€, we want a new collection to be created and set as current collection.\\nAfterwards we navigate forward on our leaflet, which means we navigate to the task view. Filename: listings/todo/8/window/mod.rs mod imp; use std::fs::File; use adw::prelude::*; use adw::subclass::pre